import React, { Component } from 'react'

export default class About extends Component {
    constructor(props){
        super(props);
        this.state = {
            title:"hayaaaa"
        };
    }
  render() {
    return (
      <div>
        <h1 className="hello">{this.state.title}</h1>
      </div>
    )
  }
}
